query LogIn($username: String!, $password: String!) {
  logIn(username: $username, password: $password) {
    __typename
    code
    token
    message
    success
    user {
      __typename
      ...UserDetails
    }
  }
}
fragment UserDetails on User {
  __typename
  prefix
  givenName
  middleName
  lastName
  role
}

